import Data from './Data'

  const Cont = () => {

    const conts = [
        { 
        'id': 1,
        'small': 'no', 
        'nam': "John Doe",
        'email' : 'flipper@columbia.com' 
        },

        { id: 2, name: "Victor Wayne" },
        { id: 3, name: "Jane Doe" },
      ];

      return (
        <>
          {conts.map((cont) => (
             <Data num = {cont.id} sml = {cont.sml} nam = {cont.nam} email = {cont.email}/>
          ))}
        </>
      );
    };

  export default Cont
